import PropTypes from 'prop-types'
import face1 from '../../assets/images/face-male-1.jpg';
import StyledAvatar from "./style";

function avatar(props) {
    return (
        <StyledAvatar>
            <div>

            </div>
            <div>
                <img src={face1} alt="" />
            </div>
        </StyledAvatar>
    )
}

avatar.propTypes = {}

export default avatar
